import React from 'react';
import { useState, useEffect } from 'react';
import '../../src/App.css';
export const Navbar = () => {
    return (
        <div className='Navbar'>
        <form>
        <input type="search" placeholder="Search..."></input>
        <button type="submit"></button>
        </form>
        <button><i>@</i></button>
        </div>
    );
}
export default Navbar;
